import React from 'react';
import { Text, StyleSheet } from 'react-native';

const Title = ({ text }) => {
  return <Text style={styles.title}>{text}</Text>;
};

const styles = StyleSheet.create({
  title: {
        marginTop: 10, 
        marginBottom: 10,  
        fontSize: 32,
        color: "#36457D",
        fontWeight: 700,
        textAlign: 'center',
  },
});

export default Title;
